import React from 'react';
import './App.css';
import Jumbotron from 'react-bootstrap/Jumbotron';
import Container from 'react-bootstrap/Container';



const App = () => (
  <Container className="p-3">
    <Jumbotron>
      <h1 className="header text-center" >Median-Col</h1>

        <p className="">Median Col, the app assist developers in moving to new places to find their dream job!</p>


    </Jumbotron>
  </Container>
);

export default App;
